import React, { useEffect, useState } from 'react';
import productService from '../../services/productService';

const ManageProducts = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const fetchProducts = async () => {
      const data = await productService.getAllProducts();
      setProducts(data);
    };
    fetchProducts();
  }, []);

  const handleEdit = (productId) => {
    // Implement edit logic or navigation
    alert(`Edit product ${productId}`);
  };

  const handleDelete = async (productId) => {
    await productService.deleteProduct(productId);
    setProducts(prev => prev.filter(product => product._id !== productId));
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Manage Products</h2>
      <table className="min-w-full bg-white">
        <thead>
          <tr>
            <th className="py-2">Product ID</th>
            <th className="py-2">Name</th>
            <th className="py-2">Category</th>
            <th className="py-2">Price</th>
            <th className="py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product._id}>
              <td className="py-2">{product._id}</td>
              <td className="py-2">{product.name}</td>
              <td className="py-2">{product.category}</td>
              <td className="py-2">â‚¹{product.price}</td>
              <td className="py-2">
                <button className="px-2 py-1 bg-blue-500 text-white rounded mr-2" onClick={() => handleEdit(product._id)}>Edit</button>
                <button className="px-2 py-1 bg-red-500 text-white rounded" onClick={() => handleDelete(product._id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ManageProducts;
